import './App.css';


const Person = (props) =>{
  return(
    <>
      <h1>Name: {props.name}</h1>
      <h1>{props.secondline}</h1>
      <h4>{props.thirdline}</h4>
    </>
  )
}


const App= () =>{
  return (
    <div className="App">
        <Person
        name="Arpit"
        secondline="oh"
        thirdline="ok"
        />
        <Person/>
        <Person/>
        <Person/>
        <Person/>
    </div>
  );
}

export default App;
